function: "This is a clip mount for 35 mm DIN rail.\r\n\r\nhttp://en.wikipedia.org/wiki/DIN_rail\r\n\r\nI had a relay for a radio that was already DIN rail and I needed to mount some plugs and cables. \r\n\r\nhttp://www.flickr.com/photos/zignig/sets/72157621190394069/\r\n\r\nSo I fired up blender and Modeled a DIN clip.\r\n\r\nTIP:\r\n\r\nGetting the sizing just right on a reprap is a bit tricky , so I printed out thin ones ( ~= 5 layers ) to get the size just so.\r\n\r\nI used this for a ham radio that I have mounted in my car. \r\n\r\n:)\r\n\r\nzignig"
